def load_song(song):
    song_bytes = BytesIO(song.encode())
    rate, signal = wavfile.read(song_bytes)
    mfcc_features = mfcc(signal, rate, numcep=20)
    mfcc_features = mfcc_features.mean(axis=0)
    return mfcc_features.reshape(1, -1)

